export default function Menu(prop){
    const nombre=prop.nombre
    if (nombre !=='nadie'){
        return(
            <div className="Menu">
                <button>Juan</button>
                <button>Salir</button>
                {console.log(nombre)}
            </div>
        )
    }
    return(
        <div className="Menu">
                <button>Ingreso</button>
                <button>Egreso</button>
            </div>
    )
}
